from typing import List


class Solution:
    def numSubarraysWithSum(self, nums: List[int], goal: int) -> int:
        l1, l2, r = 0, 0, 0  # [l1, r), [l2, r), l1 <= l2 < r
        s1, s2 = 0, 0
        ret = 0
        # 遍历所有r
        while r < len(nums):
            s1 += nums[r]
            s2 += nums[r]
            r += 1
            while l1 < r and s1 > goal:
                s1 -= nums[l1]
                l1 += 1
            while l2 < r and s2 >= goal:
                s2 -= nums[l2]
                l2 += 1
            ret += l2 - l1
        return ret


